import './button.css';

const Button = ({ label }) => {
  const getButtonClase = (label) => {
    let buttonClass = 'auth__btn';

    switch(label) {
      case '카카오로 로그인':
        buttonClass += 'kakao';
        break;
      case '네이버로 로그인':
        buttonClass += 'naver';
        break;
      case '구글로 로그인':
        buttonClass += 'google';
        break;
      case '회원가입':
        buttonClass += 'register';
        break;
      default:
        break;
    };

    return buttonClass;
  };

  return (
    <>
        <button className={getButtonClase(label)}>
          <p className='auth__btn_label'>{label}</p>
        </button>
    </>
  )
}

export default Button
